(1, 1, 'Ένας σχολιαστής WordPress', 'wapuu@wordpress.example', 'https://wordpress.org/', '', '2023-09-19 11:47:27', '2023-09-19 08:47:27', 'Γεια σας, αυτό είναι ένα σχόλιο.\nΓια να ξεκινήσετε με την έγκριση, επεξεργασία και διαγραφή σχολίων, παρακαλώ επισκεφθείτε την οθόνη Σχόλια στον Πίνακα Ελέγχου.\nΤα άβαταρ των σχολιαστών προέρχονται από το <a href=\"https://en.gravatar.com/\">Gravatar</a>.', 0, '1', '', 'comment', 0, 0);
