(382, 78, 'home__page_info_description', 'Ο όμιλος ΕΛΛΗΝΙΚΗ ΠΡΩΤΕΙΝΗ ιδρύθηκε το 1995 με στόχο να δημιουργήσει ελληνικά γαλακτοκομικά και τυροκομικά προϊόντα υψηλής ποιότητας, καθώς και βρεφικά γάλατα σε σκόνη. Αποστολή μας είναι να ανταποκρινόμαστε καθημερινά στον ανταγωνιστικό διεθνή χώρο προσφέροντας προϊόντα που ανταποκρίνονται στις ανάγκες όλων των κατηγοριών και ηλικιών. Γι’ αυτό δημιουργήσαμε τη σειρά προϊόντων REAL GREEK DAIRIES. Η πορεία του ομίλου ΕΛΛΗΝΙΚΗ ΠΡΩΤΕΙΝΗ περιλαμβάνει σημαντικά ορόσημα, που αντικατοπτρίζουν την ανάπτυξη και την επιτυχία μας.'),
