(2623, 207, '_home__company_banner_1_heading', 'field_650ac849647c6'),
(2624, 207, 'home__company_banner_1_text', 'Είμαστε υπερήφανοι για την ελληνική μας καταγωγή και αξιοποιούμε τα παραδοσιακά και ποιοτικά χαρακτηριστικά των ελληνικών προϊόντων. Τα προϊόντα μας παράγονται από αίγειο και πρόβειο γάλα, προσφέροντας μια μοναδική γευστική εμπειρία.'),
