(2637, 207, '_home__company_banner_2_heading', 'field_650ac89314d66'),
(2638, 207, 'home__company_banner_2_text', 'Η φάρμα αιγών αναδεικνύεται ως ένα από τα κεντρικά σημεία της πρωτοποριακής προσέγγισης της REAL GREEK DAIRIES. Πέρα από το να αποτελεί πηγή ποιοτικού και υγιεινού γάλακτος, η φάρμα διαδραματίζει έναν διπλό ρόλο: αυξάνει τη βιωσιμότητα της επιχείρησης και αποτελεί πρότυπο για τη νέα γενιά των παραγωγών.'),
