(2652, 207, 'home__company_subheading', 'Με έδρα μας την Ευρώπη, έχουμε επεκταθεί στην Κίνα και τις Ηνωμένες Πολιτείες. Αυτό μας επιτρέπει να φέρνουμε τα προϊόντα μας κοντά σε ακόμα περισσότερους ανθρώπους που αναζητούν υγιεινή διατροφή και υψηλή ποιότητα σε προϊόντα πλούσια σε γεύση.'),
