(1, 1, '2023-09-19 11:47:27', '2023-09-19 08:47:27', '<!-- wp:paragraph -->\n<p>Καλωσορίσατε στο WordPress!  Αυτό είναι το πρώτο σας άρθρο.  Αλλάξτε το ή διαγράψτε το και αρχίστε να γράφετε!</p>\n<!-- /wp:paragraph -->', 'Καλημέρα κόσμε!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2023-09-19 11:47:27', '2023-09-19 08:47:27', '', 0, 'http://localhost/realgreekdairies/?p=1', 0, 'post', '', 1),
(2, 1, '2023-09-19 11:47:27', '2023-09-19 08:47:27', '<!-- wp:paragraph -->\n<p>Αυτή είναι μια σελίδα παράδειγμα. Είναι διαφορετική από ένα άρθρο στο ιστολόγιο γιατί θα μείνει σε ένα μέρος και θα εμφανίζεται στο μενού πλοήγησης(στα περισσότερα θέματα). Οι περισσότεροι ξεκινούν με μια Περί σελίδα η οποία παρουσιάζει τις δυνατότητες του ιστότοπου. Μπορεί να λέει κάτι όπως αυτό:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Να΄\'μαι και εγω! Είμαι διανομέας με ποδήλατο την ημέρα, εμπνευσμένος τραγουστικής το βράδυ και αυτός είναι ο ιστότοπος μου. Ζω στην Σαντορίνη και έχω ένα σκύλο που τον λένε άργο, και μου αρέσουν οι βουτιές στη θάλασσα.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...ή κατι σαν αυτό:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Η εταιρεία ΧΨΩ ΑΕ ιδρύθηκε το 1971, και προσφέρει τις υπηρεσίες στο κοινό από την ίδρυσή της. Βρίσκεται στη Γκοθαμ Σιτυ, με 1.000 εργαζόμενους και προσφέρει όλες τις καταπλητικές της υπηρεσίες στην κοινότητα της πόλης.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Ως νέος χρήστης του WordPress, θα πρέπει να πάτε στη <a href=\"http://localhost/realgreekdairies/wp-admin/\">διαχείρισή σας</a> για να διαγράψετε αυτή την σελίδα και να δημιουργήσετε νέες σελίδες για το περιεχόμενο σας. Να περάσετε όμορφα!</p>\n<!-- /wp:paragraph -->', 'Δείγμα σελίδας', '', 'trash', 'closed', 'open', '', 'sample-page__trashed', '', '', '2023-09-19 12:27:21', '2023-09-19 09:27:21', '', 0, 'http://localhost/realgreekdairies/?page_id=2', 0, 'page', '', 0),
(3, 1, '2023-09-19 11:47:27', '2023-09-19 08:47:27', '<!-- wp:heading --><h2>Ποιοί είμαστε</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Προτεινόμενο κείμενο: </strong>Η διεύθυνση της σελίδας είναι: http://localhost/realgreekdairies.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Σχόλια</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Προτεινόμενο κείμενο: </strong>Όταν οι επισκέπτες αφήνουν σχόλια στον ιστότοπο, συλλέγουμε τα δεδομένα που εμφανίζονται στη φόρμα σχολίων όπως επίσης τη διεύθυνση IP του επισκέπτη και τη συμβολοσειρά του χρήστη του προγράμματος περιήγησης ώστε να βοηθήσουμε στην ανίχνευση ανεπιθύμητων μηνυμάτων.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Μια ανωνυμοποιημένη συμβολοσειρά που δημιουργήθηκε από τη διεύθυνση ηλεκτρονικού ταχυδρομείου σας (επίσης αποκαλούμενη \"hash\") ενδέχεται να παρασχεθεί στην υπηρεσία Gravatar για να δει αν τη χρησιμοποιείτε. Η πολιτική απορρήτου της υπηρεσίας Gravatar διατίθεται εδώ: https://automattic.com/privacy/. Μετά την έγκριση του σχολίου σας, η εικόνα του προφίλ σας είναι ορατή στο κοινό μέσα στο πλαίσιο του σχολίου σας.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Πολυμέσα</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Προτεινόμενο κείμενο: </strong>Εάν μεταφορτώνετε εικόνες στον ιστότοπο, θα πρέπει να αποφύγετε τη μεταφόρτωση εικόνων με ενσωματωμένα δεδομένα τοποθεσίας (EXIF GPS). Οι επισκέπτες του ιστότοπου μπορούν να πραγματοποιήσουν λήψη και εξαγωγή οποιωνδήποτε δεδομένων τοποθεσίας από εικόνες στον ιστότοπο.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Προτεινόμενο κείμενο: </strong>Αν αφήσετε ένα σχόλιο στον ιστότοπό μας, μπορείτε να επιλέξετε να αποθηκεύσετε το όνομα, τη διεύθυνση ηλεκτρονικού ταχυδρομείου και τον ιστότοπό σας σε cookies. Αυτά είναι για την δική σας ευκολία, έτσι ώστε να μην χρειάζεται να συμπληρώσετε τα στοιχεία σας πάλι όταν αφήσετε ένα άλλο σχόλιο. Αυτά τα cookies θα διαρκέσουν για ένα έτος.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Αν έχετε έναν λογαριασμό και συνδεθείτε στον ιστότοπο, θα δημιουργήσουμε ένα προσωρινό cookie για να προσδιορίσουμε αν ο φυλλομετρητής σας δέχεται cookies. Το cookie δεν περιέχει προσωπικές πληροφορίες και θα διαγράφει μόλις κλείσετε τον φυλλομετρητή σας.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Όταν συνδεθείτε, θα δημιουργήσουμε επίσης διάφορα cookies για να αποθηκεύσετε τις πληροφορίες σύνδεσης και τις επιλογές οθόνης. Τα cookie εισόδου διαρκούν για δύο ημέρες και τα cookie επιλογών οθόνης διαρκούν για ένα χρόνο. Αν επιλέξετε &quot;Να με θυμάσαι&quot;, η σύνδεσή σας θα παραμείνει για δύο εβδομάδες. Αν αποσυνδεθείτε από το λογαριασμό σας, τα cookie σύνδεσης θα καταργηθούν.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Εάν επεξεργαστείτε ή δημοσιεύσετε ένα άρθρο, ένα επιπλέον cookie θα αποθηκευτεί στο πρόγραμμα περιήγησης. Αυτό το cookie δεν περιλαμβάνει προσωπικά δεδομένα και υποδεικνύει απλώς το post ID του άρθρου που μόλις επεξεργαστήκατε. Λήγει μετά από 1 ημέρα.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Ενσωματωμένο περιεχόμενο από άλλους ιστότοπους</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Προτεινόμενο κείμενο: </strong>Τα άρθρα σε αυτόν τον ιστότοπο ενδέχεται να περιλαμβάνουν ενσωματωμένο περιεχόμενο (π.χ. βίντεο, εικόνες, άρθρα κ.λπ.). Το ενσωματωμένο περιεχόμενο από άλλους ιστότοπους συμπεριφέρεται με τον ίδιο ακριβώς τρόπο όπως και αν ο επισκέπτης επισκέφθηκε τον άλλο ιστότοπο.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Αυτοί οι ιστότοποι ενδέχεται να συλλέγουν δεδομένα για εσάς, χρησιμοποιούν cookies, ενσωματώνουν επιπλέον παρακολούθηση τρίτου μέρους και να παρακολουθούν την αλληλεπίδρασή σας με αυτό το περιλαμβανόμενο περιεχόμενο, συμπεριλαμβανομένης της ανίχνευσης της αλληλεπίδρασής σας με το περιλαμβανόμενο περιεχόμενο, εάν έχετε λογαριασμό και έχετε συνδεθεί στον συγκεκριμένο ιστότοπο.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Με ποιούς μοιραζόμαστε τα δεδομένα σας</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Προτεινόμενο κείμενο: </strong>Αν έχετε ζητήσει επαναπροσδιορισμό συνθηματικού, η διεύθυνση IP θα περιλαμβάνεται στο email επαναπροσδιορισμού.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Για πόσο καιρό διατηρούμε τα δεδομένα σας</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Προτεινόμενο κείμενο: </strong>Εάν αφήσετε ένα σχόλιο, το σχόλιο και τα μεταδεδομένα του διατηρούνται επ\' αόριστον. Αυτό γίνεται ώστε να μπορούμε να αναγνωρίζουμε και να εγκρίνουμε αυτόματα τα σχόλια που ακολουθούν, αντί να τα κρατάμε σε ουρά συντονισμού.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Για χρήστες που εγγράφονται στον ιστότοπο μας, αποθηκεύουμε επίσης τα προσωπικά δεδομένα που καταχωρούν στο προφίλ χρήστη τους. Όλοι οι χρήστες μπορούν να βλέπουν, να επεξεργάζονται ή να διαγράφουν τα προσωπικά δεδομένα τους ανά πάσα στιγμή (εκτός από το να μπορούν να αλλάξουν το όνομα χρήστη τους). Οι διαχειριστές του παρόντος ιστότοπου μπορεί επίσης να βλέπουν και να επεξεργάζονται αυτές τις πληροφορίες.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Ποια δικαιώματα έχετε στα δεδομένα σας</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Προτεινόμενο κείμενο: </strong>Εάν έχετε λογαριασμό σε αυτόν τον ιστότοπο ή έχετε αφήσει σχόλια, μπορείτε να ζητήσετε να λάβετε ένα εξαγόμενο αρχείο των προσωπικών δεδομένων που διατηρούμε για εσάς, συμπεριλαμβανομένων τυχόν δεδομένων που έχετε παράσχει σε εμάς. Μπορείτε επίσης να αιτηθείτε να διαγράψουμε τα προσωπικά δεδομένα που διατηρούμε για εσάς. Αυτό δεν περιλαμβάνει δεδομένα που είμαστε υποχρεωμένοι να τηρούμε για διοικητικούς, νομικούς ή λόγους ασφαλείας.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Πού αποστέλλονται τα δεδομένα σας</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Προτεινόμενο κείμενο: </strong>Τα σχόλια επισκεπτών ενδέχεται να ελέγχονται μέσω ενός αυτοματοποιημένου συστήματος ανεπιθύμητης αλληλογραφίας.</p><!-- /wp:paragraph -->', 'Πολιτική απορρήτου', '', 'draft', 'closed', 'open', '', 'πολιτική απορρήτου', '', '', '2023-09-19 11:47:27', '2023-09-19 08:47:27', '', 0, 'http://localhost/realgreekdairies/?page_id=3', 0, 'page', '', 0),
