(71, 1, '2023-09-19 16:57:46', '2023-09-19 13:57:46', 'Ο όμιλος ΕΛΛΗΝΙΚΗ ΠΡΩΤΕΙΝΗ ιδρύθηκε το 1995 με στόχο να δημιουργήσει ελληνικά γαλακτοκομικά και τυροκομικά προϊόντα υψηλής ποιότητας, καθώς και βρεφικά γάλατα σε σκόνη. Αποστολή μας είναι να ανταποκρινόμαστε καθημερινά στον ανταγωνιστικό διεθνή χώρο προσφέροντας προϊόντα που ανταποκρίνονται στις ανάγκες όλων των κατηγοριών και ηλικιών. Γι’ αυτό δημιουργήσαμε τη σειρά προϊόντων REAL GREEK DAIRIES. Η πορεία του ομίλου ΕΛΛΗΝΙΚΗ ΠΡΩΤΕΙΝΗ περιλαμβάνει σημαντικά ορόσημα, που αντικατοπτρίζουν την ανάπτυξη και την επιτυχία μας.', 'Προϊόν 1', '', 'publish', 'closed', 'closed', '', 'product-1', '', '', '2023-09-22 16:16:45', '2023-09-22 13:16:45', '', 0, 'http://localhost/realgreekdairies/?post_type=product&#038;p=71', 0, 'product', '', 0),
