(88, 1, '2023-09-19 17:05:34', '2023-09-19 14:05:34', '<div class=\"contact-form__field\">\r\n                <label class=\"contact-form__label text\" lang=\"el\" for=\"name\">Όνομα *</label>\r\n                <input class=\"contact-form__input\" lang=\"el\" type=\"text\" name=\"name\" id=\"name\" required=\"\">\r\n              </div>\r\n\r\n              <div class=\"contact-form__field\">\r\n                <label class=\"contact-form__label text\" lang=\"el\" for=\"tel\">Κινητό Τηλέφωνο *</label>\r\n                <input class=\"contact-form__input\" type=\"tel\" name=\"tel\" id=\"tel\" required=\"\">\r\n              </div>\r\n\r\n              <div class=\"contact-form__field\">\r\n                <label class=\"contact-form__label text\" for=\"email\">Email *</label>\r\n                <input class=\"contact-form__input\" type=\"email\" name=\"email\" id=\"email\" required=\"\">\r\n              </div>\r\n\r\n              <div class=\"contact-form__field contact-form__field--message\">\r\n                <label class=\"contact-form__label text\" lang=\"el\" for=\"message\">Μήνυμα *</label>\r\n                <textarea lang=\"el\" name=\"message\" id=\"message\" class=\"contact-form__input contact-form__input--message\" required=\"\"></textarea>\r\n              </div>\r\n              <div class=\"contact-form__submit-container\">\r\n                <div class=\"contact-form__field contact-form__field--terms\">\r\n                  <input class=\"contact-form__input contact-form__input--terms\" type=\"checkbox\" name=\"terms\" id=\"terms\" required=\"\">\r\n                  <label lang=\"el\" class=\"text-small contact-form__label contact-form__label--terms text\" for=\"terms\">Συμφωνώ με τους\r\n                    <a lang=\"el\" href=\"\">Όρους Χρήσης</a></label>\r\n                </div>\r\n                <div class=\"contact-form__field\">\r\n                  <button class=\"button\" type=\"submit\" value=\"Submit\">\r\n                    <span>Υποβολή</span>\r\n                  </button>\r\n                </div>\r\n              </div>\n1\n[_site_title] \"Φόρμα Επικοινωνίας\"\n[_site_title] <vpafiliaris@conceptmaniax.com>\n[_site_admin_email]\nΑπό: [name] [email]\r\nΘέμα: Φόρμα Επικοινωνίας\r\n\r\nΣώμα μηνύματος:\r\n[message]\r\n\r\n-- \r\nΑυτό το μήνυμα ηλεκτρονικού ταχυδρομείου στάλθηκε από την φόρμα επικοινωνίας του [_site_title] ([_site_url])\n\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <vpafiliaris@conceptmaniax.com>\n[your-email]\nΣώμα μηνύματος:\r\n[your-message]\r\n\r\n-- \r\nΑυτό το μήνυμα ηλεκτρονικού ταχυδρομείου στάλθηκε από την φόρμα επικοινωνίας του [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nΕυχαριστούμε για το μήνυμά σας. Στάλθηκε με επιτυχία.\nΥπήρξε σφάλμα κατά την αποστολή. Δοκιμάστε ξανά αργότερα.\nΈνα ή περισσότερα πεδία έχουν σφάλματα. Ελέγξτε και ξαναδοκιμάστε.\nΥπήρξε σφάλμα κατά την αποστολή. Δοκιμάστε ξανά αργότερα.\nΠρέπει να αποδεχτείτε τους όρους χρήσης πριν στείλετε το μήνυμα.\nΠαρακαλώ συμπληρώστε αυτό το πεδίο.\nThis field has a too long input.\nThis field has a too short input.\nΥπήρξε άγνωστο σφάλμα κατά τη μεταφόρτωση του αρχείου.\nΔεν επιτρέπεται η μεταφόρτωση τέτοιου τύπου αρχείου.\nThe uploaded file is too large.\nΥπήρξε σφάλμα κατά τη μεταφόρτωση του αρχείου.\nΠαρακαλώ συμπληρώστε την ημερομηνία σε μορφή YYYY-MM-DD.\nThis field has a too early date.\nThis field has a too late date.\nΠαρακαλώ συμπληρώστε έναν αριθμό.\nΑυτό το πεδίο έχει έναν πολύ μικρό αριθμό.\nΑυτό το πεδίο έχει έναν πολύ μεγάλο αριθμό.\nΗ απάντηση στο κουϊζ είναι λάθος.\nΠροσθέστε μία διεύθυνση email.\nΠαρακαλώ δώστε μια διεύθυνση URL.\nΠαρακαλώ εισάγετε ένα αριθμό τηλεφώνου.', 'Contact Form', '', 'publish', 'closed', 'closed', '', '%cf%86%cf%8c%cf%81%ce%bc%ce%b1-%ce%b5%cf%80%ce%b9%ce%ba%ce%bf%ce%b9%ce%bd%cf%89%ce%bd%ce%af%ce%b1%cf%82-1', '', '', '2023-09-22 13:38:55', '2023-09-22 10:38:55', '', 0, 'http://localhost/realgreekdairies/?post_type=wpcf7_contact_form&#