(5, 5, 'product_category', 'Η REAL GREEK DAIRIES χρησιμοποιεί το αγνό πρόβειο και κατσικίσιο γάλα για να παράγει φέτα και κατσικίσιο τυρί με βαθύ, γεμάτο άρωμα και πλούσια υφή. Οι τυροκόμοι μας προσεγγίζουν την τέχνη παραγωγής της φέτας με μεράκι και αφοσίωση, επιλέγοντας προσεκτικά τα καλύτερα πρόβεια και κατσικίσια γάλα για την παραγωγή της. Η παχύρευστη, κρεμώδης και πλούσια σε γεύση φέτα μας, είναι η απόδειξη ότι η ελληνική φύση προσφέρει υπέροχα υλικά για τη δημιουργία αυθεντικών και αξέχαστων γεύσεων.', 0, 1),
